import React, { useEffect, useState } from 'react';
import { View } from 'react-native';
import CardUsuario from '../../components/CardUsuario/CardUsuario';

function ListaDeUsuarios() {
  const [usuarios, setUsuarios] = useState([]);
  const [filteredUsuarios, setFilteredUsuarios] = useState([]);

  useEffect(() => {
    fetch('https://localhost:44396/api/cuidadores', {
      method: 'GET',
    })
      .then((response) => response.json())
      .then((json) => {
        setUsuarios(json);
        setFilteredUsuarios(json);
      })
      .catch((error) => {
        console.log(error);
        alert('Erro ao inserir informações');
      });
  }, []);

  const filterUsuarios = (searchText) => {
    const filtered = usuarios.filter((usuario) =>
      usuario.nome.toLowerCase().includes(searchText.toLowerCase())
    );
    setFilteredUsuarios(filtered);
  };

  return (
    <View>
      {filteredUsuarios.map((usuario, index) => (
        <CardUsuario usuario={usuario} key={index} />
      ))}
    </View>
  );
}

export default ListaDeUsuarios;
